show_appropriate_help (){
   test_for_os_type_and_set_appropriately
   set_docdir_by_os_type
   #If using the default kit name, display installation pre-help
   #(Dont' show help otherwise cause we don't know if the help matches up to a
   # cutomized kit.)
   if [[ "$MNAM" =~ htk.sh--[0-9]+.[0-9]+.[0-9]+--[0-9]{14} ]] ; then
      show_pre_help
      return 0
   fi
   if [ $# -gt 1 ] ; then
      less -p $2 $DOCDIR/usage.txt
   elif [ $# -eq 1 ] ; then
      if [ ! -e  $DOCDIR/usage.txt ] ; then
         show_pre_help
      else
         less -p $MNAM $DOCDIR/usage.txt
      fi
   fi
}
show_pre_help (){
clear
echo "                     =====================================
                     HTK Pre-Installation Help Information
                     =====================================
                 (Tap the Q key to exit from this help screen.)
 
This file is called the HyPerf Tool Kit or 'HTK'.    
 
 
Here are some thing you might want to do with it right up front...
 
---------------------------------------------------------
Browse the payload for documentation, without installing:
---------------------------------------------------------
 
   bash htk.sh --browse doc
 
 
-----------------------------------------------------------------
Extract Plush (for example) from the payload, without installing:
-----------------------------------------------------------------
 
   bash htk.sh --extract plush
 
 
----------------------------------------------------
As the **root** user, install the HTK to ${IDIR}/:
----------------------------------------------------
 
   bash htk.sh --upg
 
 
-------------------------------------------
Installation of the HTK does the following:
-------------------------------------------
1. Copies this script to $MVL
 
 
2. Then $MVL creates hard links starting with h. n. s. and x. that
   point back to itself.  The script parses itself to create the links.
 
   The links make launching HyPerf functions very easy to do.  For example,
   tapping the **Tab** key after typing 'n.' will show the available commands
   that start with 'n.'.  The same works for tapping Tab after typing 's.'
   'h.' or 'x.'.
 
   This feature makes the HTK a very effective tool from the CLI.
 
 
3. Next, if you do not have a '**'$KEYTYPE'**' key pair already created in
   your  ~/.ssh/,  then the htk.sh script creates you a key pair during the
   install.
 
 
4. The script then extracts an embedded payload from itself here...
   The work directory => $MDIR
   The doc  directory => $DOCDIR
 
 
5. When the payload has been successfully extracted, the htk.sh installer
   then prompts the user to type INSTALL or UPGRADE to copy The Plush Profile
   from the extracted payload location to the /etc directory.
 
   (The Plush Profile is embedded in the payload.)
 
 **You should install Plush UNLESS YOU SPECIFICALLY KNOW YOU DO NOT WANT IT.**
 
   Plush sets up effective bash shell aliases, variables, functions, and tips
   for rapid work.  Many of those elements are designed to work specifically
   with HyPerf.
 
   After installation, you may get additional information about PLUSH by typing
   'plush' at the CLI.  
 
 
6. The installer then parses itself and components from the payload to create
   the following function libraries for your scripting use:
   ------------------------------------------------
   $FDIR/hyperf.fnc
   $FDIR/plush.fnc
   ------------------------------------------------
 
 
7. After the installation (or upgrade) is complete, you can use the '--help'
   option to view specific information about any particular command.  Here are
   a few examples:
   --------------------------------
   Examples:   htk.sh        --help
               n.serial_exec --help
               n.hyper_exec  --help
               etc. 
   --------------------------------
 
 
(Tap the Q key to exit from this help screen.)" |less
}
